exports=async function(bid,options){const{parseInfo}=await require("transcode/parse_info"),url=`https://m.xqianqian.com/${bid.idPrefix()}/${bid}/`;return parseInfo("\u5343\u5343\u5C0F\u8BF4",url,"dd_box",{clientOptions:{...(options&&options.clientOptions)}}).then(_=>(_.intro=_.intro.toIndexOf("\u6700\u65B0\u7AE0\u8282\u63A8\u8350").trim(),_))};